var company_logo = $('.company-logo');
if(!('company_logo' in localStorage)){
    localStorage.setItem('company_logo','');
}
if(company_logo.length>0)
for(var i=0; i<company_logo.length;i++){
company_logo[0].src="data:image/png;base64,"+localStorage.getItem('company_logo');
}

var company_logo_with_name = $('.company-logo-with-name');

if(!('company_logo_with_name' in localStorage)){
    localStorage.setItem('company_logo_with_name','data:image/png;base64,');
}
if(company_logo_with_name.length>0)
for(var i=0;i<company_logo_with_name.length;i++){
    company_logo_with_name[i].src=localStorage.getItem('company_logo_with_name');
}

var user_avatar = $('.user-avatar');
if(!('user_avatar' in localStorage)){
    localStorage.setItem('user_avatar','data:image/png;base64,');
}

if(user_avatar.length>0)
for(var i=0; i<user_avatar.length;i++){
    user_avatar[i].src=localStorage.getItem('user_avatar')
}





